import React, { useState, useEffect } from 'react';
import queryString from 'query-string';
import io from 'socket.io-client';

  const Game = ({location}) => {

    useEffect(() => {
      const data = queryString.parse(location.search);
      console.log(data);
    })

    return (
      <h1>Game</h1>
    )
  }

export default Game;
